function Page2() {
	const [data, setData] = React.useState(null);
	
	React.useEffect(() => {
		fetch("/api")
			.then((res) => res.json())
			.then((data) => setData(data.message));
	})
	return (
			<div>
				<h1>{!data ? "Loading..." : data}</h1>
			</div>
			);
}

export default page2;
